import React, { Component } from "react";
class NavComp extends Component {
  state = {};
  render() {
    return (
      <div>
        <ul class="nav nav-tabs">
          <li class="nav-item">
            <a class="nav-link active" href="#">
              Debt
            </a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">
              Bills
            </a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">
              Calendar
            </a>
          </li>
        </ul>
      </div>
    );
  }
}

export default NavComp;
